import InfosPerso from '../pages/InfosPerso'
import InfosContact from '../pages/InfosContact'
import Dashboard from '../pages/Dashboard'
import React, { useState } from 'react'

function NouvelEleve() {
    const [activePage, setActivePage] = useState(0)
    const tab = [
        <InfosPerso activePage={activePage} setActivePage={setActivePage} />,
        <InfosContact activePage={activePage} setActivePage={setActivePage} />
    ]

    return <div className="relative">{tab[activePage]}</div>
}

export default NouvelEleve
